    def clickedNext(self):
            a = []
            a.append(self.comboBox.currentText())
            a.append(Cp.actual_launch_coord[Cp.name_launch.index(self.comboBox.currentText())])
            a.append(self.comboBox_2.currentText())
            a.append(Cp.actual_impact_coord[Cp.name_impact.index(self.comboBox_2.currentText())])
            if self.checkBox.isChecked() == True:
                    a.append(1)
                    a.append(self.lineEdit_2.text())
                    if self.checkBox_5.isChecked() == True:
                            a.append(1)
                            a.append(self.lineEdit_5.text())
                    elif self.checkBox_6.isChecked() == True:
                            a.append(2)
                            a.append(self.lineEdit_6.text())
                    elif self.checkBox_7.isChecked() == True:
                            a.append(3)
                            a.append(self.lineEdit_7.text())
            elif self.checkBox_2.isChecked() == True:
                    a.append(2)
                    a.append(self.timeEdit.text())
                    if self.checkBox_5.isChecked() == True:
                            a.append(1)
                            a.append(self.lineEdit_5.text())
                    elif self.checkBox_6.isChecked() == True:
                            a.append(2)
                            a.append(self.lineEdit_6.text())
                    elif self.checkBox_7.isChecked() == True:
                            a.append(3)
                            a.append(self.lineEdit_7.text())
            a.append(self.lineEdit.text())
            Cp.event_array.append(a)
